class WebSite{
    #coordinates;
    #cities;

    constructor(){
        this.#coordinates = [[55.75, 37.57], [59.57, 30.19]];
        this.#cities = ['Москва', 'Санкт-Петербург'];
    }

    setUserLocation(){
        localStorage.setItem('city', 'Санкт-Петербург')

        const city = localStorage.getItem('city');

        if(city != null && this.#cities.includes(city)){
            this.#cities.filter(function(a, b){
                console.log(a, b);
                if(a == city){
                    return -1;
                }else if (b == city){
                    return -1;
                }else{
                    return 0;
                }
            });
            console.log(this.#cities);
        }
    }
}

const webSite = new WebSite();

export default webSite;
